import React from 'react';

const NavBar = () => {
  return (
    <nav className="bg-white p-4 flex justify-between items-center shadow-md flex-wrap">
      <h1 className="text-xl font-semibold text-gray-800">Mohamed Ali</h1>
      <ul className="flex gap-4">
        <li><a href="/" className="text-gray-800 hover:text-blue-500 transition-colors duration-300">Home</a></li>
        <li><a href="/about" className="text-gray-800 hover:text-blue-500 transition-colors duration-300">About</a></li>
        <li><a href="/projects" className="text-gray-800 hover:text-blue-500 transition-colors duration-300">Projects</a></li>
        <li><a href="/techstack" className="text-gray-800 hover:text-blue-500 transition-colors duration-300">Tech Stack</a></li>
      </ul>
    </nav>
  );
};

export default NavBar;
